import React from 'react';

const Browse = () => {
  const containerStyle = {
    textAlign: 'center',
    
  };

  const headingStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '20px',
  };
  const imageStyle = {
    width: '250px', // Increase the width of the image
    height: '250px', // Increase the height of the image
    objectFit: 'cover', // Maintain aspect ratio
    borderRadius: '10px', // Optional: Add border-radius for rounded corners
  };

  const productContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
  };
  const discountCircleStyle = {
    position: 'absolute',
    top: '0',
    right: '0',
    backgroundColor: 'red',
    color: 'white',
    borderRadius: '50%',
    padding: '5px',
  }; 
  const priceStyle = {
    fontWeight: 'bold',
    margin: '5px 0',
  };
  const mainMRPStyle = {
    textDecoration: 'line-through',
    margin: '5px 0',
  };
  const priceContainerStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  };
  
  const productStyle = {
    margin: ' 10px', // Adjust the margin as needed
  };

  const imageStyles = {
    width: '400px', // Adjust the width as needed
    height: '400px', // Adjust the height as needed
    objectFit: 'cover', // Maintain aspect ratio
    borderRadius: '10px', // Optional: Add border-radius for rounded corners
  };

  // const priceStyle = {
  //   marginTop: '10px',
  //   fontSize: '18px',
  //   fontWeight: 'bold',
  //   color: 'green', // Optional: Set the color for the price
  // };
  const paradesign = { padding :'50px',
  };

  return (
    <div style={containerStyle}>
        
      <h1 style={headingStyle} >OUR PRODUCTS
      </h1>

      <div style={productContainerStyle}>
        <div style={productStyle}>
          <img
            src="/Images_page-0001.jpg"
            alt="Tree 1"
            style={imageStyles}
          />
          <p style={priceStyle}>$50.00</p>
        </div>

        <div style={productStyle}>
          <img
            src="/image 3.png"
            alt="Tree 2"
            style={imageStyles}
          />
          <p style={priceStyle}>$65.00</p>
        </div>
        <div style={productStyle}>
          <img
            src="/Images-2_page-0001.jpg" 
            alt="Tree 2"
            style={imageStyles}
          />
          <p style={priceStyle}>$65.00</p>
        </div>
        
      </div>



      <div style={productContainerStyle}>
        <div style={productStyle}>
          <img
            src="/Image 5_page-0001.jpg"
            alt="Tree 1"
            style={imageStyles}
          />
          <p style={priceStyle}>$50.00</p>
        </div>
        <div style={productStyle}>
          <img
            src="/image 6_page-0001.jpg"
            alt="Tree 1"
            style={imageStyles}
          />
          <p style={priceStyle}>$50.00</p>
        </div><div style={productStyle}>
          <img
            src="/image 7_page-0001.jpg"
            alt="Tree 1"
            style={imageStyles}
          />
          

          <p style={priceStyle}>$50.00</p>
          </div>
        <div style={productStyle}>
          <img
            src="/Images-3_page-0001.jpg"
            alt="Tree 1"
            style={imageStyles}
          />
          <p style={priceStyle}>$50.00</p>
        </div>
        <div style={productStyle}>
      <h1>Hello from Products</h1>
      <div style={imageContainerStyle}>
        <div style={imageStyles}>
          <div style={discountCircleStyle}>-30%</div>
          <img
            src="/Image 5_page-0001.jpg"
            alt="Tree 1"
            style={{ width: '100%' }}
          />
          <div style={priceContainerStyle}>
            <p style={mainMRPStyle}>$70.00</p>
            <p style={priceStyle}>$50.00</p>
          </div>
        </div>
      </div>
    </div>
    </div>
    </div> 
  );
};

export default Browse;
